	module.exports = "---\nname: \"mustache\"\nx: \"250\"\ny: \"1000\"\nscale: \".25\"\n---\n## Mustache `{{}}`\n\n* Logic-less templating\n* Well-defined spec\n* Implementations in 25+ languages\n  * Cross-language templating\n\n```markup\n{{!-- index.mustache --}}\n<div class=\"container\">\n    <ul class=\"products\">\n        {{#products}}\n            {{> product}}\n        {{/products}}\n    </ul>\n</div>\n\n{{!-- product.mustache --}}\n<li class=\"product\">{{id}} - {{name}}: {{price}}</li>\n```\n\n* Support for:\n  * Variables\n  * List iteration\n  * Partials\n  * Lamdas\n";

